/*Table structure for table `tmpdtroverride` */

CREATE TABLE `tmpdtroverride` (
  `OverrideID` int(11) NOT NULL AUTO_INCREMENT,
  `dtrDate` date NOT NULL,
  `TimeInAM` time DEFAULT NULL,
  `TimeOutAM` time DEFAULT NULL,
  `TimeInPM` time DEFAULT NULL,
  `TimeOutPM` time DEFAULT NULL,
  `TimeInOT` time DEFAULT NULL,
  `TimeOutOT` time DEFAULT NULL,
  `TimeInNight` time DEFAULT NULL,
  `TimeOutNight` time DEFAULT NULL,
  `RegularTime` double(10,4) DEFAULT NULL,
  `OtHour` double(10,4) DEFAULT NULL,
  `RecordEditted` datetime NOT NULL,
  `AdminGranted` varchar(250) NOT NULL,
  `UserID` int(11) NOT NULL,
  `EmployeeID` varchar(250) DEFAULT NULL,
  PRIMARY KEY (`OverrideID`),
  UNIQUE KEY `dtrDate` (`dtrDate`,`EmployeeID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tmpdtroverride` */

/* Function  structure for function  `Days360` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `Days360`(Today DATE, sDate DATE) RETURNS double
BEGIN
	/* Function created by Eng'r Nolan F. Sunico */
	RETURN (Datediff(Today,sDate))/365;
END */$$
DELIMITER ;

/* Function  structure for function  `FilterHour` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `FilterHour`(H double(10,2)) RETURNS double(10,2)
BEGIN
	/* Function created by Eng'r Nolan F. Sunico */
	RETURN(if(H>=8,8.0,ifnull(H,0.00)));
    END */$$
DELIMITER ;

/* Function  structure for function  `fnCheckExist` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `fnCheckExist`(
    iEmpCode varchar(255),iDate date) RETURNS tinyint(1)
BEGIN
    	DECLARE myexist INT(11);
	select count(*) as Exist into myexist from `tmpdtr`
	WHERE `tmpdtr`.`EmployeeID` = iEmpCode and dtrDate=iDate;
	return myexist;
    END */$$
DELIMITER ;

/* Function  structure for function  `fnCountTardiness` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `fnCountTardiness`(
    iemployee_id int(11)) RETURNS int(11)
    READS SQL DATA
BEGIN
    	DECLARE myint INT(11);
	SET myint=0;
	SELECT count(*) into myint FROM tempsdtr WHERE employee_id=iemployee_id;
	return myint;
    END */$$
DELIMITER ;

/* Function  structure for function  `GetAge` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetAge`(Birthdate date,cd date) RETURNS double
BEGIN
	 /* Function created by Eng'r Nolan F. Sunico 
        This will computes age of a given Birthdate with the current date*/
	RETURN (Select (YEAR(cd)-YEAR(Birthdate)) - (RIGHT(cd,5)<RIGHT(Birthdate,5))
	AS Age);
    END */$$
DELIMITER ;

/* Function  structure for function  `GetBasicByMonthYear` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetBasicByMonthYear`(
	myMonth int(11),
	myYear int(11),
	myEmployeeID varchar(250)) RETURNS decimal(20,2)
BEGIN
	-- Function Created by Eng'r Nolan Sunico
	-- This Function is use to get the Basic Salary of each employee for month and year
	DECLARE Amount DECIMAL(20,2);
	SELECT sum(GetRegularSalary(dtr.SalaryMode,dtr.RegularRate,dtr.NumberDays,(dtr.TotNumDays-dtr.NumberDays)*dtr.RegularRate)) INTO Amount
	from dtr where month(dtr.BeginDate)=myMonth and year(dtr.BeginDate)=myYear
	and dtr.EmployeeID=myEmployeeID
	group by dtr.EmployeeID;
	RETURN ifnullVal(Amount);
	-- End Function
    END */$$
DELIMITER ;

/* Function  structure for function  `GetColaByMonthYear` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetColaByMonthYear`(
	myMonth INT(11),
	myYear INT(11),
	iEmployeeID VARCHAR(250)) RETURNS decimal(20,2)
BEGIN
	-- Function Created by Eng'r Nolan Sunico
	-- This Function is use to get the Basic Salary of each employee for month and year
	DECLARE Amount DECIMAL(20,2);
	SELECT SUM(dtr.ColaRate*dtr.NumberDays) INTO Amount
	FROM dtr
	WHERE MONTH(BeginDate)=myMonth AND YEAR(BeginDate)=myYear
	AND EmployeeID=iEmployeeID
	GROUP BY dtr.EmployeeID;
	RETURN ifnullVal(Amount);
	-- End Function
    END */$$
DELIMITER ;

/* Function  structure for function  `GetContribution` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetContribution`(pDate DATE, empID varchar(250) , ConID bigint(11)) RETURNS decimal(25,8)
BEGIN
	/* Function created by Eng'r Nolan F. Sunico */
	declare EMShare decimal(10,2);
	SELECT Distinctrow employeededuction.EmployeeShare into EMShare
	FROM employeededuction, salarydeduction, contribution
	WHERE employeededuction.DeductionID = salarydeduction.DeductionID
	AND PayrollDate=pDate
	AND salarydeduction.ContributionID = contribution.ContributionID AND
        PayrollDate = pDate AND
        salarydeduction.ContributionID =ConID AND
	employeededuction.EmployeeID = empID;
	set EMShare=ifnullval(EMShare);
	return EMShare;
END */$$
DELIMITER ;

/* Function  structure for function  `GetDeductionByDate` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetDeductionByDate`(
	mEmployeeID VARCHAR(250),
	mStartDate DATE,
	mEndDate DATE,
	mContributionID INT(11)) RETURNS decimal(20,2)
BEGIN
	-- Function Created by Eng'r Nolan Sunico
	-- This Function is use to get the contribution of each employee for month and year
	DECLARE Amount DECIMAL(20,2);
	SELECT SUM(employeededuction.EmployeeShare) INTO Amount
	FROM employeededuction INNER JOIN salarydeduction ON(salarydeduction.DeductionID=employeededuction.DeductionID)
	INNER JOIN contribution ON(contribution.ContributionID=salarydeduction.ContributionID)
	WHERE contribution.ContributionID=mContributionID AND employeededuction.EmployeeID=mEmployeeID
	AND PayrollDate BETWEEN mStartDate AND mEndDate; 
	-- GROUP BY MONTH(PayrollDate), employeededuction.DeductionID;
	RETURN ifnullVal(Amount);
	-- End Function
    END */$$
DELIMITER ;

/* Function  structure for function  `GetDeductionByMonthYear` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetDeductionByMonthYear`(
	mEmployeeID VARCHAR(250),
	myMonth INT(11), 
	myYear INT(11),
	mPayrollDate DATE,
	mContributionID INT(11)) RETURNS decimal(20,2)
BEGIN
	-- Function Created by Eng'r Nolan Sunico
	-- This Function is use to get the contribution of each employee for month and year
	DECLARE Amount DECIMAL(20,2);
	SELECT SUM(employeededuction.EmployeeShare) INTO Amount
	FROM employeededuction INNER JOIN salarydeduction ON(salarydeduction.DeductionID=employeededuction.DeductionID)
	INNER JOIN contribution ON(contribution.ContributionID=salarydeduction.ContributionID)
	WHERE MONTH(PayrollDate)=myMonth AND YEAR(payrollDate)=myYear AND contribution.ContributionID=mContributionID
	AND PayrollDate=mPayrollDate AND employeededuction.EmployeeID=mEmployeeID-- BETWEEN '2009-07-02' AND '2009-12-30'
	-- and (PayrollDate=cast(concat(myYear,'-',myMonth,'-01') as Date) or PayrollDate=CAST(CONCAT(myYear,'-',myMonth,'-08') AS DATE)
	-- or PayrollDate=CAST(CONCAT(myYear,'-',myMonth,'-16') as Date) or PayrollDate=CAST(CONCAT(myYear,'-',myMonth,'-23') as Date))
	GROUP BY MONTH(PayrollDate), employeededuction.DeductionID;
	RETURN ifnullVal(Amount);
	-- End Function
    END */$$
DELIMITER ;

/* Function  structure for function  `GetDepartment` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetDepartment`(dpID varchar(100)) RETURNS varchar(250) CHARSET latin1
BEGIN
	/* Function created by Eng'r Nolan F. Sunico */
   RETURN (Select DepartmentName from department where DepartmentID=trim(dpID));
END */$$
DELIMITER ;

/* Function  structure for function  `GetDepartmentIDFromEmployee` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetDepartmentIDFromEmployee`(eID varchar(250)) RETURNS varchar(100) CHARSET latin1
BEGIN
	/* Function created by Eng'r Nolan F. Sunico */
	RETURN(Select DepartmentID from employee where EmployeeID = eID);
    END */$$
DELIMITER ;

/* Function  structure for function  `GetDescription` */

DELIMITER $$

