/* Function  structure for function  `GetNumberOfSundays` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetNumberOfSundays`(s date, e date) RETURNS int(11)
BEGIN
	/* This Function created by Eng'r Nolan F. Sunico March 16, 2009 ,,This Function will
	   Check how many sundays will fall on the given date range */
	declare cnSundays int;
        set cnSundays=0;
	WHILE s <= e  DO
	     if (DayName(s)='Sunday') then
		  set cnSundays=cnSundays+1;
	     end if;
	     Set s=adddate(s,1);
	END WHILE;
	return cnSundays;
    END */$$
DELIMITER ;

/* Function  structure for function  `GetOTByMonthYear` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetOTByMonthYear`(
	myMonth INT(11),
	myYear INT(11),
	iEmployeeID VARCHAR(250)) RETURNS decimal(20,2)
BEGIN
	-- Function Created by Eng'r Nolan Sunico
	-- This Function is use to get the Basic Salary of each employee for month and year
	DECLARE Amount DECIMAL(50,2);
	SELECT sum(AdditionalCompensation) INTO Amount
	FROM finaldeduction
	WHERE MONTH(finaldeduction.BeginDate)=myMonth AND YEAR(finaldeduction.BeginDate)=myYear
	AND finaldeduction.EmployeeID=iEmployeeID
	GROUP BY finaldeduction.EmployeeID;
	RETURN ifnullVal(Amount);
	-- End Function
    END */$$
