/* Procedure structure for procedure `GetSummaryDtr` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `GetSummaryDtr`(bDate DATE, eDate DATE,cutDate DATE, nDays DOUBLE(4,2), dpID VARCHAR(100),nHolidays INT(10), nSundays INT(10), nSalaryMode VARCHAR(250), empID VARCHAR(250))
BEGIN
	/* Stored Procedure by Eng'r Nolan Sunico  
           This procedure will post Biometric details from dtr import module to Dtr module*/
	#Cursor to Get The number of sundays in a given Date Range 
	DECLARE CountDays INT(11);
	DECLARE NumCutOffDate INT(11);
        DECLARE eid VARCHAR(250);
	DECLARE cur1 CURSOR FOR SELECT GetNumberOfSundays(bDate,eDate) AS CSundays;
	OPEN cur1;
	FETCH cur1 INTO CountDays;
	CLOSE cur1;
	SET NumCutOffDate=DATEDIFF(eDate,cutDate);
	IF LENGTH(empID)=0 THEN
	   SET eid='%';
	ELSE
	   SET eid=CONCAT(empID,'%');
	END IF;
	# Deduct the Sundays with Dtr(OT) as it is already inserted to Overtime Computation
	#set CountDays=CountDays-nSundays;
	# CountDays now contained the Free Sundays, if all Free Sundays already been used CountDays will now become zero 
	SELECT b.EmployeeID, bDate AS BeginDate, eDate AS EndDate, 
	IF(UCASE(TRIM(a.SalaryMode))='MONTHLY',nDays,WorkDays) AS TotNumDays, 
	IF(UCASE(TRIM(a.SalaryMode))='MONTHLY',
		IF((b.TotRegHour/8)<nDays,
			IF((b.TotRegHour/8)+CountDays+NumCutOffDate>=nDays,nDays,
			(b.TotRegHour/8)+CountDays+NumCutOffDate),
		(b.TotRegHour/8)+NumCutOffDate),
	nDays) AS NumberDays
	, b.TotRot AS Rot, b.TotND AS ND, b.TotRS AS RS, b.TotSot AS Sot, b.TotSnd AS Snd, b.TotLHR AS LHR
	, b.TotLHot AS LHot, b.TotLHnd AS LHnd, b.TotSLH AS SLH, b.TotShot AS Shot, b.TotSHnd AS SHnd, b.TotNP AS NP 
	, a.OvertimeRate, a.RegularRate, a.ColaRate, a.RegOTMul, a.NightDiffMul, a.RegSunMul, a.SunOTMul
	, a.SunNightDiffMul, a.RegLegalHoliMul, a.LegalHoliOTMul, a.LegalHoliNightDiffMul, a.SunLegalHoliMul
	, a.SunHoliOTMul, a.SunHoliNightDiffMul, a.NightPremiumMul, a.SalaryMode
	FROM payroll.salarydetails a INNER JOIN sumtmpdtr b ON a.EmployeeID=b.EmployeeID 
	WHERE b.DepartmentID = dpID AND a.SalaryMode=nSalaryMode AND b.EmployeeID LIKE eid;
END */$$
DELIMITER ;

