	VALUES (eID, bDate, eDate, regRate, colRate, 
	nDays, iRot, iND, iRS, iSot, iSnd, iLHR, iLHot, iLHnd, iSLH, 
	iSHot, iSHnd, iNP, iDeductionID, iDTRID, iDepartmentID, 
	iTotNumDays, iRegOTMul, iNightDiffMul, iRegSunMul, iSunOTMul, 
	iSunNightDiffMul, iRegLegalHoliMul, iLegalHoliOTMul, 
	iLegalHoliNightDiffMul, iSunLegalHoliMul, iSunHoliOTMul, 
	iSunHoliNightDiffMul, iNightPremiumMul, iSalaryMode);
