/* Procedure structure for procedure `Weekly` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `Weekly`(sDate Date, eDate Date, EndDate Date )
BEGIN
	/* Stored procedure by Eng'r Nolan Sunico  */
	SELECT COUNT(*) AS RecNum, a.* 
	FROM calculatedpayslip a  JOIN
	calculatedpayslip b ON a.DTRID >= b.DTRID
	WHERE (a.BeginDate BETWEEN sDate AND eDate) AND 
	a.EndDate <= EndDate
	GROUP BY a.DTRID
	ORDER BY RecNum, a.Fullname;
END */$$
