/* Procedure structure for procedure `PayrollDailySummaryReport` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `PayrollDailySummaryReport`(
	mBeginDate DATE,
	mEndDate DATE,
	mDepartment VARCHAR(250))
    READS SQL DATA
BEGIN
	-- Procedure created by Eng'r Nolan Sunico
	-- This is for generating MonthlySummaryReport by Department
	-- February 19, 2010 - 9:14 AM
	DECLARE myDP VARCHAR(250);
	CALL sp_CreateTempPayrollMonthly(); -- Create the Temporary table
	SET myDP=UCASE(mDepartment);
	IF UCASE(mDepartment)=UCASE('(ALL Department)') THEN
	    SET myDP='';
	END IF; 
	INSERT INTO TempPayrollMonthly (EmployeeID,Fullname,`Month`,BeginDate,GrossSalary,OT,Others,COLA,Deduction,DepartmentName,
	SSS,Philhealth,`Cash Advance`,HDMFL,HDMFC,ITW,Housing,`SSS Loan`) 
	SELECT finaldeduction.EmployeeID, finaldeduction.Fullname, MONTHNAME(finaldeduction.BeginDate) AS `Month`,finaldeduction.BeginDate,
	`finaldeduction`.`RegularSalary`  AS RegularSalary, finaldeduction.AdditionalCompensation  AS OT,  finaldeduction.Unpaid_Obligation  AS Others,  
	finaldeduction.Cola AS COLA,  finaldeduction.Deduction AS Deduction, finaldeduction.DepartmentName,
	GetDeductionByDate(finaldeduction.EmployeeID,BeginDate,mEndDate,1) AS SSS,
	GetDeductionByDate(finaldeduction.EmployeeID,BeginDate,mEndDate,2) AS PhilHealth,
	GetDeductionByDate(finaldeduction.EmployeeID,BeginDate,mEndDate,3) AS `Cash Advance`,
	GetDeductionByDate(finaldeduction.EmployeeID,BeginDate,mEndDate,5) AS HDMFL,
	GetDeductionByDate(finaldeduction.EmployeeID,BeginDate,mEndDate,6) AS HDMFC,
	GetDeductionByDate(finaldeduction.EmployeeID,BeginDate,mEndDate,7) AS ITW,
	GetDeductionByDate(finaldeduction.EmployeeID,BeginDate,mEndDate,8) AS Housing,
	GetDeductionByDate(finaldeduction.EmployeeID,BeginDate,mEndDate,9) AS `SSS Loan` 
	FROM finaldeduction
	WHERE UCASE(finaldeduction.SalaryMode)='DAILY' 
	AND UCASE(finaldeduction.DepartmentName)LIKE CONCAT(myDP,'%') 
	AND finaldeduction.BeginDate BETWEEN mBeginDate AND mEndDate 
	-- GROUP BY finaldeduction.`EmployeeID`, finaldeduction.`BeginDate` 
	ORDER BY finaldeduction.Fullname; 
	-- Return the results
	SELECT *, 'DAILY', mDepartment AS myDepartment, YEAR(BeginDate) AS mYear FROM TempPayrollMonthly ORDER BY Fullname, BeginDate;
	-- End of Procedure
    END */$$
DELIMITER ;

