	INSERT INTO TempPayrollMonthly (EmployeeID,Fullname,`Month`,BeginDate,GrossSalary,OT,Others,COLA,Deduction,DepartmentName,
	SSS,Philhealth,`Cash Advance`,HDMFL,HDMFC,ITW,Housing,`SSS Loan`) 
	SELECT finaldeduction.EmployeeID, finaldeduction.Fullname, MONTHNAME(finaldeduction.BeginDate) AS `Month`,finaldeduction.BeginDate,
	SUM(`finaldeduction`.`RegularSalary`) AS RegularSalary,SUM(finaldeduction.AdditionalCompensation) AS OT, SUM(finaldeduction.Unpaid_Obligation) AS Others,  
	SUM(finaldeduction.Cola) AS COLA, SUM(finaldeduction.Deduction) AS Deduction, finaldeduction.DepartmentName,
	GetDeductionByMonthYear(finaldeduction.EmployeeID,mMonth,mYear,finaldeduction.BeginDate,1) AS SSS,
	GetDeductionByMonthYear(finaldeduction.EmployeeID,mMonth,mYear,finaldeduction.BeginDate,2) AS PhilHealth,
	GetDeductionByMonthYear(finaldeduction.EmployeeID,mMonth,mYear,finaldeduction.BeginDate,3) AS `Cash Advance`,
	GetDeductionByMonthYear(finaldeduction.EmployeeID,mMonth,mYear,finaldeduction.BeginDate,5) AS HDMFL,
	GetDeductionByMonthYear(finaldeduction.EmployeeID,mMonth,mYear,finaldeduction.BeginDate,6) AS HDMFC,
