	GetDeductionByMonthYear(finaldeduction.EmployeeID,mMonth,mYear,finaldeduction.BeginDate,9) AS `SSS Loan` 
	FROM finaldeduction
	WHERE UCASE(finaldeduction.SalaryMode)=UCASE(mSalaryMode)
