	ORDER BY finaldeduction.Fullname, finaldeduction.BeginDate; 
	-- Return the results
	SELECT *, mSalaryMode, mDepartment AS myDepartment, mYear FROM TempPayrollMonthly ORDER BY Fullname, BeginDate;
	-- End of Procedure
    END */$$
